import React, { useEffect, useState } from 'react'
import { getSalesHistorySoldOut } from './getSalesHistorySoldOut'
import LayOutTable from '../LayOut/LayOutTable'

const LayOutSalesHistorySoldOut = ({ submitCode }) => {
    const [data, setData] = useState([])
    useEffect(
        () => {
            const fetchApi = async () => {
                const response = await getSalesHistorySoldOut(submitCode)
                setData(response)
            }
            fetchApi()
        }, [submitCode]
    )
    return (
        <>
            <LayOutTable title={Sold } data1={'size'} data2={'price'} data3={'date'} array={data} />
        </>
    )
}

export default LayOutSalesHistorySoldOut
